G.f. A(x) satisfies:
(1) A(x) = Series_Reversion(x - x*A(A(x))).
(2) A(x) = x + Sum_{n=1} d^(n-1)/dx^(n-1) x^n * A(A(x))^n / n!.
(3) A(x) = x*exp( Sum_{n=1} d^(n-1)/dx^(n-1) x^n * A(A(x))^n/x / n! ).
Define A_{n} such that A_{n+1}(x) = A( A_{n}(x) ) with A_0(x) = x,
then A_{n}(x) = A_{n-1}/[1 - A_{n+2}(x)] ;
thus A_{n}(x) = 1 - A_{n-3}(x) / A_{n-2}(x).
G.f. A(x)/x is the unique solution to variable A in the infinite system of simultaneous equations starting with:
A = 1 + x*A*C;
B = A + x*B*D;
C = B + x*C*E;
D = C + x*D*F;
E = D + x*E*G; ...

G.f. A(x) satisfies:
(1) A(x) = Series_Reversion(x - x*A(A(A(x)))).
(2) A(x) = x + Sum_{n=1} d^(n-1)/dx^(n-1) x^n * A(A(A(x)))^n / n!.
(3) A(x) = x*exp( Sum_{n=1} d^(n-1)/dx^(n-1) x^n * A(A(A(x)))^n/x / n! ).
Define A_{n} such that A_{n+1}(x) = A( A_{n}(x) ) with A_0(x) = x,
then A_{n}(x) = A_{n-1}/[1 - A_{n+3}(x)] ;
thus A_{n}(x) = 1 - A_{n-4}(x) / A_{n-3}(x).
G.f.: A(x)/x is the unique solution to variable A in the infinite system of simultaneous equations starting with:
A = 1 + x*A*D;
B = A + x*B*E;
C = B + x*C*F;
D = C + x*D*G;
E = D + x*E*H; ...

Consider the set partitions of the n-set {1,2,...,n}. As usual, Bell(n) means the Bell numbers. The i-th set partition SP(i)={U(1),...U(Z(i))} consists of Z(i) subsets U(j) with j=1,2,...,Z(i). |U(j)| is the number of elements in U(j). Then a(n) = sum_{i=1}^{Bell(n)} prod_{j=1}^{Z(i)} A005651(|U(j)|) E.g.f.: series((1/exp(1))*exp(mul(1/(1-x^k/k!),k=1..12)),x=0,12);
a(n) = (n-1)! sum_{k=1}^{n} (a(n-k) A005651(k))/((n-k)! (k-1)!). - Thomas Wieder, Sep 09 2008
a(n) = sum_{k=1}^{n} C(n-1,k-1) A005651 a(n-k) and a(0)=1. - Thomas Wieder, Sep 12 2008

Define:
n, a positive integer congruent to 11 (mod 12);
o, 2n + 1;
Mn, Mersenne number n: A000225(n);
Pn, pseudoperfect number n: A006516(n) and note its simple construction from Mn: Pn = A000217(A000225(n)) = (Mn^2 + Mn + 1) / 2 = (4^n - 2^n) / 2;
Fo, figurate kernel o = A000217(o) - o = (o^2 - o) / 2.
Observe that Pn (mod Fo) is calculable by modular exponentiation.
Then n is a Sophie Germain prime and o is its matching safe prime iff Pn is congruent to o (mod Fo). n and o are therefore members of a Cunningham chain.

Define sm4(x)^4 = cm4(x)^4 - 1, where sm4(x) is the g.f. of A153301, then:
d/dx cm4(x) = sm4(x)^3 ;
d/dx sm4(x) = cm4(x)^3 .

Define cm4(x)^4 = 1 + sm4(x)^4, where cm4(x) is the g.f. of A153300, then:
d/dx sm4(x) = cm4(x)^3 ;
d/dx cm4(x) = sm4(x)^3 .
